import { Close, Menu } from "@mui/icons-material";
import { IconButton } from "@mui/material";
import React from "react";

export default function MenuIcon({ show, toggle }) {
  return (
    <IconButton
      onClick={toggle}
      size="large"
      color={show ? "default" : "error"}
      sx={menuStyle}
    >
      {show ? <Close sx={{ fontSize: 35 }} /> : <Menu sx={{ fontSize: 35 }} />}
    </IconButton>
  );
}

const menuStyle = {
  position: "absolute",
  right: "1rem",
  top: "1rem",
};
